import React, {Component} from 'react'
import './Hello.css'

class Hello extends Component {
    render () {
        return (
            <div className='tc f1'>
                <h1>Hello world</h1>
                <p>Welcome to React</p>
                <p>{this.props.greeting}</p>
            </div>
        )
    }
}

export default Hello
